// this is a component for rendering one song
// we will use the instance of it to render as many songs as we want
// from resultSongs variable
import React from 'react';

// id il vom da dintro functie
// primeste 2 props de la parent SearchResults
function Songs ({song, id}){
    return(
        <div>
            <p>{id}{song.title}{songs.album.title}</p>
            <audio controls src={songs.preview}></audio>
            <button>+</button>
        </div>
    );
}

export default Songs;
